#183: "Hey #145, go for it you'll thank me later."

for reference:
#145: "There's this RT-7 boy that I have quite a crush on...he's handsome, funny, quirky, kind, well-read, cultured, a perfect gentleman, and *straight*. Amazing, right? Anyway, I wish he saw me as more than just a friend, but I'm pretty sure he doesn't and never will, so I'm just going to get over these feelings and not weird out a perfectly good friendship."
